INSERT INTO `JournalArticle` VALUES ('dbaaab45-6f4f-413b-9be4-bed8c425a3d3',10586,10591,10182,10155,10199,'admin admin','2015-06-25 09:18:43','2015-04-04 04:10:14',0,0,0,'/0/','WELCOME',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<dynamic-element name=\"content\" type=\"text_area\" index-type=\"keyword\" index=\"0\">\n		<dynamic-content language-id=\"en_US\"><![CDATA[\n			\n				<style type=\"text/css\">\n					h2.welcome-title {\n						font-size: 35px;\n						margin: 0 0 40px;\n					}\n\n					h4.subtitle {\n						font-size: 24px;\n						line-height: 30px;\n						margin-bottom: 0;\n					}\n\n					.welcome-content {\n						font-size: 15px;\n						margin: 0;\n					}\n\n					.welcome-content a {\n						text-decoration: none;\n					}\n\n					.welcome-content a:hover {\n						text-decoration: underline;\n					}\n\n					.welcome-content .welcome-text {\n						line-height: 22px;\n						margin: 0;\n					}\n\n					.welcome-content .pdf {\n						display: inline-block;\n						margin-top: 25px;\n					}\n\n					.welcome-content .welcome-icon {\n						float: left;\n						margin: 4px 0;\n						padding-right: 38px;\n					}\n\n					@media all and (max-width: 767px) {\n						h2.welcome-title {\n							font-size: 24px;\n						}\n\n						h4.subtitle {\n							margin: 32px 0 4px;\n						}\n\n						.welcome-content-wrapper {\n							text-align: center;\n						}\n\n						.welcome-content .welcome-icon {\n							float: none;\n							padding: 0;\n						}\n					}\n				</style>\n\n				<div class=\"welcome-content-wrapper\">\n					<h2 class=\"welcome-title\">\n						Welcome To Liferay Portal\n					</h2>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/10182/0/welcome_cube+1/9f2392df-7abc-4fc3-99e3-16dbaec3d6c7?t=1428120613000?version=1.0\" />\n\n						<h4 class=\"subtitle\">\n							Start\n						</h4>\n\n						<p class=\"welcome-text\">\n							Review our <a href=\"http://www.liferay.com/welcome-start?v1.0\" target=\"_blank\">Quick Start Guide</a> for an overview of Liferay\'s features.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/10182/0/welcome_learn+1/9193aaa3-7750-4300-a0fd-11b0dd081b78?t=1428120613000?version=1.0\" />\n\n						<h4 class=\"subtitle\">\n							Learn\n						</h4>\n\n						<p class=\"welcome-text\">\n							Read the official <a href=\"http://www.liferay.com/welcome-learn?v1.0\" target=\"_blank\">Liferay User Guide</a> for detailed information about setting up and configuring Liferay.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/10182/0/welcome_community+1/2a16eb8b-a56b-4bc4-9ab3-0b110e8a79e3?t=1428120614000?version=1.0\" />\n\n						<h4 class=\"subtitle\">\n							Engage\n						</h4>\n\n						<p class=\"welcome-text\">\n							Visit the <a href=\"http://www.liferay.com/welcome-engage?v1.0\" target=\"_blank\">Liferay Community</a> to post questions, find answers, and contribute.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/10182/0/welcome_tools+1/b2a66143-db05-4537-8342-b0e143b25d45?t=1428120612000?version=1.0\" />\n\n						<h4 class=\"subtitle\">\n							Develop\n						</h4>\n\n						<p class=\"welcome-text\">\n							Explore our <a href=\"http://www.liferay.com/welcome-develop?v1.0\" target=\"_blank\">Developer Resources</a> to develop apps and more for Liferay Portal.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-ico