purchase and get in touch with you.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>If your web visitor goes</strong>, guess where they might be going? Your competitor’s website no doubt!</p>\n\n<p>&nbsp;</p>\n\n<p>Your website needs to represent everything that your customer needs to know about your business. They need to feel like they are in the right place for what they are looking for, they need to trust your website and what it sells, and be able to easily get to where they want to go next- to find out more or buy your products or services!</p>\n\n<p>&nbsp;</p>\n\n<p>Our website dev and design experts are on hand to make sure that your website works for you as it should.</p>\n\n<p>What should a website do? All of our websites:</p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><strong>Represent your brand</strong> as you envisioned- with the best clear cut design and functionality for your business. This will turn your web visitors into customers</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><strong>Work smoothly</strong>, with no bugs and with easy browsing- don’t make your web visitors work hard- after all, happy customers are the ones you can best help, and are the ones who will buy from you</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><strong>Work quickly</strong>- in this fast-paced age, time is everything- by keeping your web visitor waiting, they won’t want to stick around</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><strong>Inspire and compel customers to act</strong>- let’s face it, you’re in business to sell your products and services. Your website therefore needs to, in some way, compel the right visitors to act in ways that help you achieve your business goals</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><strong>Increase your credibility</strong>- every business in this day and age needs online presence. That said, poorly designed, developed and written websites can do more damage to your credibility than no website. Ensure that your website is appropriate for your target market, and is accurately written and designed.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>Here’s how our website pros work with you to achieve our top quality websites:</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><strong>Decide on design</strong>- your website needs to be the right fit for your entire marketing strategy. We’ll work with you to decide on a design that sits well with you, that you know you’ll be proud to show and that helps your business goals.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li value=\"2\"><strong>Confirm development</strong>- the dev part of your website project is crucial. Development works to make sure that your website works smoothly and effectively, and can be used in the way that you imagined.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li value=\"3\"><strong>Quality assurance</strong>- this is our opportunity to guarantee you the quality you need to grow your business and market it effectively. You’ll have the opportunity to test the website, and we’ll smooth out all bugs, if any.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li value=\"4\"><strong>Testing</strong>- these are our final checks to make sure that you are 100% happy with the final product.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li value=\"5\"><strong>Live!-</strong> your website then goes live. You’ll have the opportunity to test to see how your web visitors are responding to your website, and what changes you can make in your marketing to ensure that your website is as effective as possible.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p>Are you ready to take your business to the next level with your own personal website designer and developer?</p>\n\n<p>Contact us today...</p>\nOr read what our clients have to say and view our portfolio.]]></static-content>\n</root>','general','','','','2015-04-04 11:29:00',NULL,NULL,1,0,0,'',0,10199,'admin admin','2015-04-04 11:31:51'),('e10c1923-ca0e-42fe-a1b6-1d12a612c76a',11127,11119,10182,10155,10199,'admin admin','2015-04-04 20:40