evel with your own personal website designer and developer?</p>\n\n<p>Contact us today...</p>\nOr read what our clients have to say and view our portfolio.]]></static-content>\n</root>','general','','','','2015-04-04 11:29:00',NULL,NULL,1,0,0,'',0,10199,'admin admin','2015-04-04 20:40:51'),('0d23de5b-a519-48ee-b100-f7989a67368d',11132,11133,10182,10155,10199,'admin admin','2015-04-04 11:32:58','2015-04-04 11:32:58',0,0,0,'/0/','11131',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Services App Development </Title></root>','services-app-development-','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<p><strong>Interestingly, all businesses, big or small are working hard to gain the attention of their customers. We live in an age where people are bombarded with information and opportunities to consume with an attention deficit. This makes it even harder for you, as a business to engage in a meaningful way with your customers.</strong></p>\n\n<p><strong>This is why many businesses are developing their own app as an effective way to market their products and services.</strong></p>\n\n<p align=\"center\">The average person uses their smart phone 9 times every hour during peak times.</p>\n\n<p><strong>Whether your business’ main focus is to develop and sell a unique, complex app or, whether it is a side project for your main business, an app can be a highly effective way of building and maintaining rewarding interactions with your customers.</strong></p>\n\n<p>Your app should:</p>\n\n<ul>\n	<li><strong>Represent your brand positively</strong>- whatever the purpose of your branded app, the more helpful or informative your app, the more it will improve your business’ credibility. We’ll make sure that your app’s design perfectly represents your brand</li>\n	<li><strong>Work smoothly</strong>- life moves quickly in the mobile world- we’ll make sure that your app is easy and enjoyable to use</li>\n	<li><strong>Inspire and compel customers to act</strong>- an app gives your clients an opportunity to interact with your brand in a helpful or informative way. This interaction can strengthen the relationship your customers have with your brand, encouraging them to act and further desire your services</li>\n	<li><strong>Add another element to your services, products and marketing</strong>- many apps allow for social interaction and even gamification. You’ll be providing exciting and helpful experiences to your customers.</li>\n</ul>\n\n<p>Here’s how our app development and design pros work with you to achieve our top quality applications:</p>\n\n<ol>\n	<li><strong>Decide on design</strong>- we’ll work with you, side-by-side, to be sure that your finished app will look as you envisioned. We’ll also bring our own expertise to the table, and help you to decide on a design we know your users will love.</li>\n	<li value=\"2\"><strong>Confirm development</strong>- the dev part of your app creation is the ins and outs of how your app users will experience the app</li>\n	<li value=\"3\"><strong>Quality assurance</strong>- this is our opportunity to guarantee you a smooth, swish and quality app.</li>\n	<li value=\"4\"><strong>Testing</strong>- we’ll complete the final tests of your app, to be sure that it works 100% as you intended.</li>\n	<li value=\"5\"><strong>Live!-</strong> your app goes live on the operating system agreed in advance. We’ll walk you through this process step-by-step, so that you are ready to advertise and promote your app in an effective way.</li>\n</ol>\n\n<p>Are you ready to dive into the world of application development? Whether you’ve got a big app idea, or are wondering how an app could fit into your business, get in touch today. Our experts can help to turn your ideas into reality.</p>\n\n<p>Or read what our clients have to say and view our portfolio.</p>]]></static-content>\n</root>','general','','','','2015-04-04 11:31:00',NULL,NULL,1,0,0,'',0,10199,'admin admin','2015-04-04 11:32:58'),('44277eed-e399-4c8f-b6d7-fbca977ee399',11142,11143,10182,10155,10199,'admin admin','2015-04-07 03:01:47','2015-04-07 03:01:47',0,0,0,'/0/','11141',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Services</Title></root>','services','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div id=\"services\">\n</div>]]></static-content>\n</root>','general','','','','2015-04-07 03:01:00',NULL,NULL,1,0,0,'',0,10199,'admin admin','2015-04-07 03:01:47'),('3eecf1dc-f428-4992-9ebc-4137cadab956',11151,11143,10182,10155,10199,'admin admin','2015-04-07 03:36:05','2015-04-07 03:36:05',0,0,0,'/0/','11141',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Services</Title></root>','services','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div id=\"services\">\n<h1 style=\"display: block;\" class=\"headerLoad\">Our Services</h1>\n</div>]]></static-content>\n</root>','general','','','','2015-04-07 03:01:00',NULL,NULL,1,0,0,'',0,10199,'admin admin','2015-04-07 03:36:05'),('fa878c76-2945-4ad3-92d7-8324b15a1cd7',11155,11143,10182,10155,10199,'admin admin','2015-04-07 08:58:35','2015-04-07 08:58:35',0,0,0,'/0/','11141',1.2,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Services</Title></root>','services','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div id=\"services\">\n<h1 class=\"headerLoad\" style=\"display: block;\">Our Services