pertise that make it a success.<br />\nWhether you are:</p>\n\n<ul>\n	<li>A Founder building your start up from the ground up</li>\n	<li>A Business Developer or marketer expanding your small-medium sized business</li>\n	<li>A corporate CEO</li>\n</ul>\n\n<p align=\"center\"><strong><span style=\"font-size:14px;\">The skills, talents and expertise of IT professionals is crucial for your business success</span>.</strong></p>\n</div>\n</div>\n\n<div class=\"row-fluid\">\n<div class=\"span12\">\n<p><strong>Why should you outsource to an IT pro?</strong></p>\n\n<p>Outsourcing software development is an emerging popular trend.</p>\n\n<p>Business owners and software developers are reaping the benefits of outsourcing:</p>\n\n<ul>\n	<li>reduce costs to compete in the global arena and expand internationally</li>\n	<li>mitigate risk and work with experts</li>\n	<li>allow for greater mobility and flexibility in exploring and capturing business opportunities</li>\n	<li>leverage your financial resources and human talent to focus on more urgent and important matters for your business</li>\n</ul>\n\n<p>IT Outsourcer LTD. is also a specialized agency that can handle outsourced IT projects with superior technological capabilities than other organizations.</p>\n\n<p>Leverage the benefits of outsourcing your tech/web projects to the best professionals in the industry.</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>]]></static-content>\n</root>','general','','','','2015-04-04 11:21:00',NULL,NULL,1,0,0,'',0,10199,'admin admin','2015-07-18 15:15:17'),('54753ebd-9db4-4182-860d-43d94b132e72',12138,12029,10182,10155,10199,'admin admin','2015-07-22 09:12:23','2015-07-22 09:12:23',0,0,0,'/0/','12027',1.5,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">References with clients</Title></root>','reference-with-clients','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<